import React from 'react';
import { motion } from 'framer-motion';

const Process = () => {
  const timelineData = [
    {
      year: 2000,
      event: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.',
    },
    {
      year: 2005,
      event: 'Ut semper odio ac sapien malesuada placerat.',
    },
    {
      year: 2010,
      event: 'Nullam tristique massa a est lobortis, vel tincidunt libero euismod.',
    },
    {
      year: 2015,
      event: 'Sed euismod turpis sit amet purus facilisis, eget malesuada diam bibendum.',
    },
    {
      year: 2020,
      event: 'Maecenas sagittis metus vel odio interdum, sed vulputate ex tempus.',
    },
  ];

  return (
    <div className="timeline-container">
      {timelineData.map((item) => (
        <motion.div
          key={item.year}
          className="timeline-item"
          initial={{ y: 50, opacity: 0 }}
          animate={{ y: 0, opacity: 1 }}
          transition={{ delay: 0.2 }}
        >
          <div className="year">{item.year}</div>
          <div className="event">{item.event}</div>
        </motion.div>
      ))}
    </div>
  );
};

export default Process;
